import logo from './logo.svg';
import './App.css';
import Pokemon from './Pokemon';
import pokemons from './Data';
import { Component } from 'react';


class App extends Component{
  render(){
    return (<Pokemon pokemon={pokemons}/>)
  }
}

export default App;
